import React, { Component } from "react";

class Warning extends Component {
    styleObj = {
        color: "white",
        background: "red"
    }
    render() {
        return (
            <div  className =" bg-danger text-dark border border-danger">
                Warning
            </div>

        )
    }
}

export default Warning;
